import React from 'react'

import ReactSearchBox from 'react-search-box'
import { Container, Row, Col } from 'react-bootstrap';


export default class Search extends React.Component {
    constructor() {
        super()

    }

    data = [
        {
            key: 'emad',
            value: 'bey',
        },
        {
            key: 'jane',
            value: 'Jane Doe',
        },
        {
            key: 'mary',
            value: 'Mary Phillips',
        },
        {
            key: 'robert',
            value: 'Robert',
        },
        {
            key: 'karius',
            value: 'Karius',
        },
    
        {
            key: 'lol',
            value: 'Bay',
        },
    
    ]

    render() {
        return (
          <>
              
              <Container>
              
                <Row>
                <Col xs={6}>
                <ReactSearchBox
                    placeholder="Search movie"
                    value=""
                    data={this.data}
                    callback={record => console.log(record)}
                />

            </Col>
            </Row>
            </Container>

            </>
        );
    }
};
